import React from "react";

export const renderHarry = (playerY: number, beams: any[], PLAYER_W: number, PLAYER_H: number) => {
  const centerX = 30 + PLAYER_W/2, centerY = playerY + PLAYER_H/2;
  return (
    <g>
      <ellipse cx={centerX} cy={playerY + PLAYER_H - 8} rx={PLAYER_W/2 + 4} ry={3} fill="#8B4513" />
      <rect x={centerX - 2} y={playerY + PLAYER_H - 12} width={4} height={8} fill="#654321" />
      <rect x={centerX - 1} y={playerY + PLAYER_H - 16} width={2} height={6} fill="#8B4513" />
      <circle cx={centerX} cy={playerY + 18} r={18} fill="#F4C2A1" stroke="#D4A574" strokeWidth={2} />
      <ellipse cx={centerX - 6} cy={playerY + 18} rx={7} ry={7} stroke="#2C2C2C" strokeWidth={2.5} fill="none" />
      <ellipse cx={centerX + 6} cy={playerY + 18} rx={7} ry={7} stroke="#2C2C2C" strokeWidth={2.5} fill="none" />
      <line x1={centerX - 1} y1={playerY + 18} x2={centerX + 1} y2={playerY + 18} stroke="#2C2C2C" strokeWidth={2} />
      <circle cx={centerX - 6} cy={playerY + 18} r={2} fill="#2C2C2C" />
      <circle cx={centerX + 6} cy={playerY + 18} r={2} fill="#2C2C2C" />
      <circle cx={centerX - 5} cy={playerY + 17} r={0.8} fill="white" />
      <circle cx={centerX + 7} cy={playerY + 17} r={0.8} fill="white" />
      <ellipse cx={centerX} cy={playerY + 22} rx={1.5} ry={2} fill="#E6B89C" />
      <path d={`M ${centerX - 3} ${playerY + 26} Q ${centerX} ${playerY + 28} ${centerX + 3} ${playerY + 26}`} stroke="#2C2C2C" strokeWidth={1.5} fill="none" />
      <polyline points={`${centerX - 4},${playerY + 8} ${centerX - 1},${playerY + 12} ${centerX + 1},${playerY + 10} ${centerX + 4},${playerY + 14}`} stroke="#FFD700" strokeWidth={2.5} fill="none" />
      <rect x={30 + 8} y={playerY + 36} width={PLAYER_W - 16} height={12} fill="#7F0000" rx={6} />
      <rect x={30 + 10} y={playerY + 38} width={PLAYER_W - 20} height={8} fill="#FFD700" rx={4} />
      <rect x={30 + PLAYER_W - 2} y={playerY + PLAYER_H/2 - 1} width={20} height={2} fill="#8B4513" rx={1} />
      <circle cx={30 + PLAYER_W + 18} cy={playerY + PLAYER_H/2} r={1.5} fill="#FFD700" />
      {beams.some(b => b.active) && <circle cx={30 + PLAYER_W + 22} cy={playerY + PLAYER_H/2} r={1.2} fill="#FFD700" opacity={0.7} />}
    </g>
  );
};

export const renderObstacle = (o: any, OBSTACLE_W: number, OBSTACLE_GAP: number, GAME_HEIGHT: number) => (
  <g key={o.id}>
    <rect x={o.x} y={0} width={OBSTACLE_W} height={o.height} fill="#b8c2ff" />
    <rect x={o.x} y={o.height + OBSTACLE_GAP} width={OBSTACLE_W} height={GAME_HEIGHT - o.height - OBSTACLE_GAP} fill="#b8c2ff" />
  </g>
);

export const renderEnemy = (e: any, ENEMY_W: number, ENEMY_H: number) => {
  const centerX = e.x + ENEMY_W / 2, centerY = e.y + ENEMY_H / 2;

  // Different monster designs based on type
  const getMonsterDesign = () => {
    switch(e.type) {
      case "Dementor":
        return (
          <g>
            {/* Dementor - Dark hooded figure */}
            <ellipse cx={centerX} cy={centerY + 6} rx={ENEMY_W/2 - 1} ry={ENEMY_H/2 - 1} fill="#1a1a1a" stroke="#000" strokeWidth={1} />
            <ellipse cx={centerX} cy={e.y + 8} rx={ENEMY_W/2 - 3} ry={ENEMY_H/3 - 2} fill="#2d2d2d" />
            <rect x={e.x + 2} y={e.y + 2} width={ENEMY_W - 4} height={8} fill="#000" rx={2} />
            <circle cx={centerX - 3} cy={e.y + 6} r={1.5} fill="#ff0000" />
            <circle cx={centerX + 3} cy={e.y + 6} r={1.5} fill="#ff0000" />
            <path d={`M ${e.x + 4} ${e.y + 12} Q ${centerX} ${e.y + 15} ${e.x + ENEMY_W - 4} ${e.y + 12}`} stroke="#000" strokeWidth={2} fill="none" />
            <ellipse cx={centerX} cy={e.y + 18} rx={ENEMY_W/2 - 2} ry={4} fill="#1a1a1a" />
          </g>
        );

      case "Death Eater":
        return (
          <g>
            {/* Death Eater - Skull-like mask */}
            <ellipse cx={centerX} cy={centerY + 4} rx={ENEMY_W/2 - 2} ry={ENEMY_H/2 - 2} fill="#8b4513" stroke="#654321" strokeWidth={1.5} />
            <ellipse cx={centerX} cy={e.y + 6} rx={ENEMY_W/2 - 4} ry={ENEMY_H/3 - 1} fill="#f4a460" />
            <circle cx={centerX - 4} cy={e.y + 8} r={1.5} fill="#000" />
            <circle cx={centerX + 4} cy={e.y + 8} r={1.5} fill="#000" />
            <ellipse cx={centerX} cy={e.y + 12} rx={3} ry={1.5} fill="#000" />
            <rect x={e.x + 6} y={e.y + 14} width={ENEMY_W - 12} height={6} fill="#2d1810" />
            <path d={`M ${e.x + 8} ${e.y + 16} Q ${centerX} ${e.y + 18} ${e.x + ENEMY_W - 8} ${e.y + 16}`} stroke="#000" strokeWidth={1} fill="none" />
          </g>
        );

      case "Troll":
        return (
          <g>
            {/* Troll - Large, brutish */}
            <ellipse cx={centerX} cy={centerY + 6} rx={ENEMY_W/2 - 1} ry={ENEMY_H/2 - 1} fill="#8b7355" stroke="#5d4e37" strokeWidth={1.5} />
            <ellipse cx={centerX} cy={e.y + 4} rx={ENEMY_W/2 - 3} ry={ENEMY_H/3 - 1} fill="#a0522d" />
            <circle cx={centerX - 3} cy={e.y + 6} r={1.2} fill="#000" />
            <circle cx={centerX + 3} cy={e.y + 6} r={1.2} fill="#000" />
            <ellipse cx={centerX} cy={e.y + 10} rx={2} ry={1} fill="#000" />
            <rect x={e.x + 4} y={e.y + 12} width={ENEMY_W - 8} height={8} fill="#654321" />
            <ellipse cx={e.x + 6} cy={e.y + 16} rx={2} ry={3} fill="#8b7355" />
            <ellipse cx={e.x + ENEMY_W - 6} cy={e.y + 16} rx={2} ry={3} fill="#8b7355" />
            <path d={`M ${e.x + 2} ${e.y + 2} Q ${centerX} ${e.y} ${e.x + ENEMY_W - 2} ${e.y + 2}`} stroke="#2d1810" strokeWidth={2} fill="none" />
          </g>
        );

      case "Acromantula":
        return (
          <g>
            {/* Acromantula - Giant spider */}
            <ellipse cx={centerX} cy={centerY + 4} rx={ENEMY_W/2 - 2} ry={ENEMY_H/2 - 2} fill="#2d1810" stroke="#1a0f08" strokeWidth={1} />
            <ellipse cx={centerX} cy={e.y + 6} rx={ENEMY_W/2 - 4} ry={ENEMY_H/3 - 2} fill="#8b4513" />
            <circle cx={centerX - 3} cy={e.y + 8} r={1.5} fill="#ff0000" />
            <circle cx={centerX + 3} cy={e.y + 8} r={1.5} fill="#ff0000" />
            <circle cx={centerX - 2} cy={e.y + 7} r={0.5} fill="#fff" />
            <circle cx={centerX + 4} cy={e.y + 7} r={0.5} fill="#fff" />
            <ellipse cx={centerX} cy={e.y + 12} rx={2} ry={1} fill="#000" />
            {/* Spider legs */}
            <line x1={e.x + 2} y1={e.y + 8} x2={e.x - 2} y2={e.y + 12} stroke="#2d1810" strokeWidth={1.5} />
            <line x1={e.x + ENEMY_W - 2} y1={e.y + 8} x2={e.x + ENEMY_W + 2} y2={e.y + 12} stroke="#2d1810" strokeWidth={1.5} />
            <line x1={e.x + 4} y1={e.y + 10} x2={e.x} y2={e.y + 14} stroke="#2d1810" strokeWidth={1.5} />
            <line x1={e.x + ENEMY_W - 4} y1={e.y + 10} x2={e.x + ENEMY_W} y2={e.y + 14} stroke="#2d1810" strokeWidth={1.5} />
            <ellipse cx={centerX} cy={e.y + 16} rx={ENEMY_W/2 - 2} ry={4} fill="#1a0f08" />
          </g>
        );

      case "Werewolf":
        return (
          <g>
            {/* Werewolf - Furry beast */}
            <ellipse cx={centerX} cy={centerY + 4} rx={ENEMY_W/2 - 2} ry={ENEMY_H/2 - 2} fill="#8b7355" stroke="#5d4e37" strokeWidth={1.5} />
            <ellipse cx={centerX} cy={e.y + 4} rx={ENEMY_W/2 - 3} ry={ENEMY_H/3 - 1} fill="#a0522d" />
            <circle cx={centerX - 3} cy={e.y + 6} r={1.2} fill="#ff0000" />
            <circle cx={centerX + 3} cy={e.y + 6} r={1.2} fill="#ff0000" />
            <ellipse cx={centerX} cy={e.y + 10} rx={2.5} ry={1.5} fill="#000" />
            <rect x={e.x + 4} y={e.y + 12} width={ENEMY_W - 8} height={8} fill="#654321" />
            <ellipse cx={e.x + 6} cy={e.y + 16} rx={2} ry={3} fill="#8b7355" />
            <ellipse cx={e.x + ENEMY_W - 6} cy={e.y + 16} rx={2} ry={3} fill="#8b7355" />
            <path d={`M ${e.x + 2} ${e.y + 2} Q ${centerX} ${e.y} ${e.x + ENEMY_W - 2} ${e.y + 2}`} stroke="#2d1810" strokeWidth={2} fill="none" />
            <path d={`M ${e.x + 4} ${e.y + 4} Q ${centerX} ${e.y + 2} ${e.x + ENEMY_W - 4} ${e.y + 4}`} stroke="#2d1810" strokeWidth={1.5} fill="none" />
          </g>
        );

      default:
        return (
          <g>
            {/* Default monster */}
            <ellipse cx={centerX} cy={centerY + 4} rx={ENEMY_W/2 - 2} ry={ENEMY_H/2 - 2} fill={e.color} stroke="black" strokeWidth={1.5} />
            <circle cx={centerX - 3} cy={e.y + 8} r={1.5} fill="#ff0000" />
            <circle cx={centerX + 3} cy={e.y + 8} r={1.5} fill="#ff0000" />
            <ellipse cx={centerX} cy={e.y + 12} rx={2} ry={1} fill="#000" />
          </g>
        );
    }
  };

  return (
    <g key={e.id}>
      {getMonsterDesign()}
      {/* Monster name label */}
      <text x={centerX} y={e.y - 6} fontSize="8" fill="#fff" textAnchor="middle" stroke="black" strokeWidth={0.5} fontWeight="bold">{e.type}</text>
      {/* Glowing aura effect */}
      <ellipse cx={centerX} cy={centerY + 4} rx={ENEMY_W/2 + 3} ry={ENEMY_H/2 + 3} fill={e.color} opacity={0.15} />
    </g>
  );
};

export const renderBeams = (beams: any[]) =>
  beams.filter(b => b.active).map((b, i) =>
    <rect key={i} x={b.x} y={b.y} width={24} height={6} fill="#ffd700" rx={3} />
  );
